require.define("./client/application/selected-route-table.html", "<table class=\"table\">\n  <thead>\n  <th>Agency</th>\n  <th>Name</th>\n  <th>Mode</th>\n  <th></th>\n  </thead>\n  <tbody>\n  {{#routes}}\n  <tr>\n    <td>{{getAgencyId id}}</td>\n    <td><strong>{{shortName}}</strong> {{longName}}</td>\n    <td><span class=\"label label-default\">{{mode}}</span></td>\n    <td><span class=\"glyphicon glyphicon-remove remove-route-button\" aria-hidden=\"true\" data-agency-and-id=\"{{id}}\"></span></td>\n  </tr>\n  {{/routes}}\n  </tbody>\n</table>");

require("./client/application");
